import React from 'react';
import { useParams } from 'react-router-dom';

const Registration = () => {
  const { eventId } = useParams(); // Get eventId from URL
  const events = {
    event1: { title: "Karnival Sukan Tradisional kali ke-11" },
    event2: { title: "Pengambilan Ahli Baharu Dan Daftar Kokurikulum" },
    event3: { title: "Kembara Cekak Lestari" },
  };

  const event = events[eventId];
  if (!event) {
    return <h2>Event Not Found</h2>;
  }

  return (
    <div className="registration">
      <h1>Register for {event.title}</h1>
      <form action="/submit-registration" method="POST">
        <input type="hidden" name="eventId" value={eventId} />
        <div>
          <label htmlFor="name">Name:</label>
          <input type="text" id="name" name="name" required />
        </div>
        <div>
          <label htmlFor="matric_number">Matric Number:</label>
          <input type="text" id="matric_number" name="matric_number" required />
        </div>
        <div>
          <label htmlFor="phone">Phone:</label>
          <input type="text" id="phone" name="phone" required />
        </div>
        <div>
          <label htmlFor="email">Email:</label>
          <input type="email" id="email" name="email" required />
        </div>
        <button type="submit">Register</button>
      </form>
    </div>
  );
};

export default Registration;
